import React from 'react'

function Image(props) {
    return (
        <div>
            <div className="view overlay rounded z-depth-1 gallery-item"
                 onClick="document.getElementById('main_pic').src={props.img}">
                <img
                    src={props.img}
                    className="img-fluid lam"/>
            </div>
        </div>
    )
}
export default Image;
